import { Client as DiscordClient } from "discord.js";
import { Client } from "nekos-best.js"; const TOKEN = "************************.******.***************************"; const discordClient = new DiscordClient();
const nekosBest = new Client();
await nekosBest.init(); discordClient.on("messageCreate", async (message) => { if (message.author.bot) return; if (message.content.startsWith('!neko')) { message.channel.send((await nekosBest.fetchRandom("neko")).results[0].url); }
}) discordClient.login(TOKEN);

